// Footer.js
import React from 'react';
import './Footer.css';
import logo from '../Images/logo.png'
import facebook from '../Images/facebook.png'

function Footer() {
  return (
    <footer style={{ backgroundColor: '#29335C', textAlign: 'center', color: 'white' }}>
        <div id='footerBox'>
            <div id="footerP1">
                <div><img src={logo} width="90px" height='90px' alt="logo" /></div>
                <div id='mwmcBigFooter'>Midwest Math Circle 2023</div>
            </div>

            <div id='socials'>
                <div><img src={facebook} width="35px" height='35px' alt="logo" /></div>
                <div><img src={facebook} width="35px" height='35px' alt="logo" /></div>
                <div><img src={facebook} width="35px" height='35px' alt="logo" /></div>
                <div><img src={facebook} width="35px" height='35px' alt="logo" /></div>
            </div>

            <div id='copyright'>

            </div>
        </div>

         
    </footer>
  );
}

export default Footer;
